    [],nt"num_tags": 4,nt"name": "litchfield-wetland-management-district-annual-narrative-report-calendar-year-1978",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Litchfield
    WMD outlines District accomplishments during the 1978 calendar year. The report
    begins with an introduction to the WMD and information about weather conditions,
    habitat conditions, land acquisition activities, and the system status. Construction,
    maintenance, and wildfires are also described. Habitat management is covered; croplands,
    grasslands, wetlands, forests, and easements for waterfowl management are discussed.
    The wildlife section of the report discusses migratory birds and mammals. Interpretation
    and recreation activities are outlined; topics include information and interpretation,
    recreation, and law enforcement. Cooperative programs, items of interest, and safety
    information are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
